import { ForumDetailComponent } from './forum-detail/forum-detail.component';

@NgModule({
  declarations: [
    ForumListComponent,
    ForumDetailComponent,
    // Add other components related to the forums feature
  ],
  imports: [
    CommonModule,
    ForumsRoutingModule,
